import * as React from "react";
import { Button, View } from "react-native";

function Home({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Button
        onPress={() => navigation.navigate("Menu")}
        title="Go to Menu"
      />
    </View>
  );
}

export default Home;
